import React from 'react';



class Result extends React.Component {
    constructor(props) {
        super(props);
        console.log(`Props :${props}`);
        this.state = {
            results: []
        };
    }
    componentDidMount(){
        this.setState({
            results : this.props
        });
    }
    render() {
        const { hits } = this.props;
        console.log(`gelen hits ${hits}`);
        return (
            <div className='container'>
                <p>
                    {
                        this.state.hits.map((v, key) => {
                            return <h3>{v}</h3>
                        })
                    }
                </p>
            </div>
        );
    }
} export default Result;
